import React, { Component } from "react";
class Detail extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <div className="sideImages-container"></div>
        <div className="main-image">
          <img src="/img/item-1.png" />
        </div>
      </div>
    );
  }
}

export default Detail;
